import React from "react";

import { styled } from "@mui/material/styles";
import Box from "@mui/material/Box";
import Paper from "@mui/material/Paper";
import Card from "@mui/material/Card";
import "./CreateProduct.css";
import { Grid } from "@mui/material";

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

const CreateProduct = () => {
  const handleFormSubmit = (values) => {
    // You can dispatch an action to save the data to Redux here.
    console.log(values);
  };

  return (
    <div className="create-product">
      <Card className="varient-card">
        <Formik
          initialValues={{
            name: "",
            description: "",
            vendors: [
              { vendorName: "", isMain: false, variant: "", number: "" },
            ],
          }}
          validationSchema={productSchema}
          onSubmit={handleFormSubmit}
        >
          {({ values }) => (
            <Form>
              <div>
                <label htmlFor="name">Name:</label>
                <Field type="text" id="name" name="name" />
                <ErrorMessage name="name" component="div" className="error" />
              </div>

              <div>
                <label htmlFor="description">Description:</label>
                <Field as="textarea" id="description" name="description" />
              </div>

              <FieldArray name="vendors">
                {({ push, remove }) => (
                  <div>
                    {values.vendors.map((vendor, index) => (
                      <div key={index}>
                        <h3>Vendor #{index + 1}</h3>
                        <div>
                          <label htmlFor={`vendors.${index}.vendorName`}>
                            Vendor Name:
                          </label>
                          <Field
                            type="text"
                            name={`vendors.${index}.vendorName`}
                          />
                          <ErrorMessage
                            name={`vendors.${index}.vendorName`}
                            component="div"
                            className="error"
                          />
                        </div>

                        <div>
                          <label htmlFor={`vendors.${index}.isMain`}>
                            Is Main:
                          </label>
                          <Field
                            type="radio"
                            name={`vendors.${index}.isMain`}
                            value="true"
                          />{" "}
                          Yes
                          <Field
                            type="radio"
                            name={`vendors.${index}.isMain`}
                            value="false"
                          />{" "}
                          No
                        </div>

                        <div>
                          <label htmlFor={`vendors.${index}.variant`}>
                            Variant:
                          </label>
                          <Field as="select" name={`vendors.${index}.variant`}>
                            <option value="">Select Variant</option>
                            {/* Add your variant options here */}
                          </Field>
                        </div>

                        <div>
                          <label htmlFor={`vendors.${index}.number`}>
                            Number:
                          </label>
                          <Field as="select" name={`vendors.${index}.number`}>
                            <option value="">Select Number</option>
                            {/* Add your number options here */}
                          </Field>
                        </div>

                        <button type="button" onClick={() => remove(index)}>
                          Remove Vendor
                        </button>
                      </div>
                    ))}
                    <button
                      type="button"
                      onClick={() =>
                        push({
                          vendorName: "",
                          isMain: false,
                          variant: "",
                          number: "",
                        })
                      }
                    >
                      Add Vendor
                    </button>
                  </div>
                )}
              </FieldArray>

              <button type="submit">Submit</button>
            </Form>
          )}
        </Formik>
      </Card>
    </div>
  );
};

export default CreateProduct;
